    public static final Item GIGANTAMAX_DURALUDON_SHINY = registerItems("gigantamax_duraludon_shiny", new Item(new Item.Settings()));
    public static final Item GIGANTAMAX_URSHIFU_SINGLESTRIKE_SHINY = registerItems("gigantamax_urshifu_singlestrike_shiny", new Item(new Item.Settings()));
    public static final Item GIGANTAMAX_URSHIFU_RAPIDSTRIKE_SHINY = registerItems("gigantamax_urshifu_rapidstrike_shiny", new Item(new Item.Settings()));

    private static Item registerItems(String id, Item item) {
        return Registry.register(Registries.ITEM, Identifier.of(PokemonPhoto.MOD_ID, id), item);
    }

    public static void registerModItems() {
        PokemonPhoto.LOGGER.info("Registering gen8 pokemon photos");
    }
